import { Route, Routes } from "react-router-dom";
import Wellcome from "./Wellcome";

import AuthForm from "./AuthForm";

function App() {
    return (
        <div>
        <Routes>
        <Route
          path="/"
          element={
            <Wellcome />
            }
        />
        <Route
          path="/sign-up"
          element={
            <AuthForm 
              title={"Регистрация"}
              button={"Зарегистрироваться"}
            />
            }
        />
      </Routes>
      </div>
        
    );
  }
  
  export default App;
